var lastFiveGames = []; // Array para almacenar los √∫ltimos 5 partidos jugados

function shuffleOptions() {
    // Crear una lista ponderada de opciones en funci√≥n de la demanda
    let weightedOptions = [];
    
    // Agregar los partidos tantas veces como su demanda
    opciones.forEach(option => {
        // Usamos directamente la demanda para determinar cu√°ntas veces agregar la opci√≥n
        // La demanda va de 1 a 100, los m√°s cercanos a 100 se agregar√°n m√°s veces
        for (let i = 0; i < option.demanda; i++) {
            weightedOptions.push(option);
        }
    });

    // Mezclar las opciones ponderadas dos veces aleatoriamente
    let selectedOption = null;

    do {
        // Primera mezcla aleatoria
        weightedOptions.sort(function () {
            return 0.5 - Math.random();
        });

        // Segunda mezcla aleatoria
        weightedOptions.sort(function () {
            return 0.5 - Math.random();
        });

        // Seleccionamos el primer partido de la lista aleatoria
        selectedOption = weightedOptions[0];

    } while (lastFiveGames.includes(selectedOption) && lastFiveGames.length >= 5); // Verificamos que no haya estado en los √∫ltimos 5

    // Ejecutar el partido seleccionado
    selectedOption.partido();

    // A√±adir el partido seleccionado a los √∫ltimos 5 partidos
    lastFiveGames.push(selectedOption);

    // Si hay m√°s de 5 partidos en el array, eliminamos el m√°s antiguo
    if (lastFiveGames.length > 5) {
        lastFiveGames.shift();
    }
}


function swapTeamColors() { 
    if (cambioCami) {
        // Mezclar las opciones antes de elegir
        shuffleOptions();

        // Ejecutar la opci√≥n elegida
        let selectedOption = lastFiveGames[lastFiveGames.length - 1]; // Obtener la √∫ltima opci√≥n seleccionada
        selectedOption.partido(); // Llamar a la funci√≥n del partido seleccionado
    }
}



