// Funci√≥n para obtener emojis num√©ricos
function getNumericEmoji(number) {
  const numericEmojis = ["0Ô∏è‚É£", "1Ô∏è‚É£", "2Ô∏è‚É£", "3Ô∏è‚É£", "4Ô∏è‚É£", "5Ô∏è‚É£", "6Ô∏è‚É£", "7Ô∏è‚É£", "8Ô∏è‚É£", "9Ô∏è‚É£"];
  return number
    .toString()
    .split("")
    .map((digit) => numericEmojis[parseInt(digit)])
    .join("");
}


